const levelTraverse1 = function (root: TreeNode) {
  if (root === null) return;
  let res: number[][] = [];
  const q: TreeNode[] = [];
  q.push(root);

  // \u4ECE\u4E0A\u5230\u4E0B\u904D\u5386\u4E8C\u53C9\u6811\u7684\u6BCF\u4E00\u5C42
  while (!(q.length === 0)) {
    const nodeValues: number[] = [];
    const sz = q.length;
    // \u4ECE\u5DE6\u5230\u53F3\u904D\u5386\u6BCF\u4E00\u5C42\u7684\u6BCF\u4E2A\u8282\u70B9
    for (let i = 0; i < sz; i++) {
      const cur: any = q.pop();
      nodeValues.push(cur.val);
      // \u5C06\u4E0B\u4E00\u5C42\u8282\u70B9\u653E\u5165\u961F\u5217
      if (cur.left !== null) {
        q.push(cur.left);
      }
      if (cur.right !== null) {
        q.push(cur.right);
      }
    }

    res.push(nodeValues);
  }

  return res;
};
